// Refactor values to needed format
function fixValues(input) {
  	let phoneRegEx = /^(\d{3}-)?\d{3}-\d{4}$/;
	let finalResult = "";
	//is this a date and not a number
	if (moment(input, dateFormats, true).isValid()) {
  		finalResult = '[' + input + ']'; //to fit the format [2016-08-20T18:04:26Z]
  	} else if (_.isEqual(_.toLower(input), 'false')) {
      	finalResult = false; //to fit the format externalFlag = false
    } else if (_.isEqual(_.toLower(input), 'true')) {
      	finalResult = true; //to fit the format externalFlag = true
    } else if (_.isString(input) && input.indexOf(",") == -1 && isNaN(input)) {
  		if (input.search(phoneRegEx) === 0) {
			// is a Phone Number
			input = input.replace(/-/g, '');
		} 
  		finalResult = '\"' + input + '\"'; //to fit the format summary="xyz"
  	} else {
		//not a string or a date
		finalResult = input;
	}
	return finalResult;
}

function fixNameValues(input) {
	let finalResult = "";
	if (input.indexOf(".") > -1) {
		finalResult = input.split('.').join('/');
		// finalResult = input.replace(/./g, "/");
	} else if (input.indexOf("[") > -1 && input.indexOf("]") > -1) {
		let subObject = input.substring(input.lastIndexOf("[") + 1, input.lastIndexOf("]"));
		let object = input.substring(0, input.indexOf("["));
		finalResult = object + '/' + subObject;
	} else {
		// not a subObject query
		finalResult = input;
	}
	return finalResult;
}

function buildQuery(expression) {
	let fieldName = expression.attribute;
  	let value = expression.value;
  	let op = expression.operator;
  	value = fixValues(value);
  	fieldName = fixNameValues(fieldName);
	if (op === 'IN') {
	    return  fieldName + " in ("+ value + ')';
	} else if (op === 'LIKE') {
  		return  fieldName + " like " + value;
  	} else {
  		return fieldName + op + value;
  	}
}

